// webgazerSetup.js
import WebGazer from 'webgazer';

const initializeWebGazer = () => {
  WebGazer.setGazeListener((data, elapsedTime) => {
    if (data) {
      // จัดการข้อมูลการมองเห็นที่ได้รับ
      console.log(data.x, data.y);
    }
  }).begin();
};

const stopWebGazer = () => {
  WebGazer.end();
};

export { initializeWebGazer, stopWebGazer };
